  false,\n\t\"url\": null,\n\t\"notes\": \"This spreadsheet contains Thermal Conductivity
  data complied by the Delaware Geological Survey and the Virginia Department of Mines,
  Minerals and Energy, Division of Geology and Mineral Resources, published as a Web
  feature service for the National Geothermal Data System. The document contains 7
  worksheets, including information about the template, notes related to revisions
  of the template, resource provider information, the data, a field list (data mapping
  view), and a worksheet with vocabularies for use in populating the spreadsheet (data
  valid terms). Data includes 236 observations. Field names in the template include
  Measurement Procedure, Average Thermal Conductivity, Geologic Formation Type, and
  Sample Depth, among others.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
